import React from 'react';


const List = ({ onRouteChange, loadCategory }) => {
    return(
        <div>
                            <div>
                                <div>
                                <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('ramen');}}
                                        className='f3 link dim black underline pa3 pointer'>ラーメン</h2>
                                </div>
                                <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('food');}}
                                        className='f3 link dim black underline pa3 pointer'>食事処</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('view');}}
                                        className='f3 link dim black underline pa3 pointer'>景色</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('cafe');}}
                                        className='f3 link dim black underline pa3 pointer'>カフェ</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('park');}}
                                        className='f3 link dim black underline pa3 pointer'>公園</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('club');}}
                                        className='f3 link dim black underline pa3 pointer'>クラブ</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('bar');}}
                                        className='f3 link dim black underline pa3 pointer'>バー</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('study');}}
                                        className='f3 link dim black underline pa3 pointer'>勉強する場所</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('hiking');}}
                                        className='f3 link dim black underline pa3 pointer'>ハイキング</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('shopping');}}
                                        className='f3 link dim black underline pa3 pointer'>買い物</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('beauty');}}
                                        className='f3 link dim black underline pa3 pointer'>美容系</h2>
                                </div>
                                </div>
                            </div>
        </div>
    );
}

export default List;
